  console.log('hey over here' , match.url)
    return (
      <div className='shop-page'>
      <Switch> 
        <Route path={match.url}>
          <CollectionOverview />
        </Route>
        <Route path='/ayhaga' >
          <CollectionPage /> 
        </Route>
      </Switch>
      </div>
    )
}

export default ShopPage;
